// src/components/LandingPage.js
import React from "react";
import "./LandingPage.css";
import Navbar from "./Navbar";

const LandingPage = () => {
  return (
    <div>
      <Navbar />
      <main>
        <div className="main-container">
          <div className="div-content">
            <h1>
              Indian Food is <br /> more than curry
            </h1>
            <p>Try your next new recipe</p>
            <button>Get started</button>
          </div>
          <div className="div-content">
             <img src="placeholder1.jpg" alt="Samosas on wooden board" />
            <img src="placeholder2.jpg" alt="Dosa with accompaniments" />
            <img src="placeholder3.jpg" alt="Indian appetizer" />
            <img src="placeholder4.jpg" alt="Orange appetizers with chutney" />

          </div>
        </div>
      </main>
    </div>
  );
};

export default LandingPage;
